const formatDate = (exp: IExperience) => {
  if (exp.to === 0) {
    return `${format(exp.from, "MMM, yyyy")} - present`;
  }

  return `${format(exp.from, "MMM, yyyy")} - ${format(exp.to, "MMM, yyyy")}`;
};

